    //     startDate : "01-01-2022",
    //     endDate : "01-12-2022" ,
    //     numberOfBugs : 1000,
    //     numberOfDependencies : "45%",
    //     codeReviews : "21%",
    //     unitTesting :"10%",
    //     delay : 45
    // },
    // ]

    useEffect(() => {
        if ( id ) {
            axios.get(`http://127.0.0.1:8000/api/${id}`)
                .then(res => {
                    console.log(res)
                    setDashboardData(res.data)
                })
                .catch(err => {
                    console.log(err)
                })
        }
    }, [ id ]);
    return (
        <div>

                {dashboardData && dashboardData.map((data) =>
                    <ProjectCardData data={data} />
                )}
            </div>
    )
}

export default ProjectCard;
